import React, { Component } from "react";
import "./work.css";
class Work extends Component {
  state = {};
  render() {
    return (
      <React.Fragment>
        <div class="mainDiv">
          <link rel="stylesheet" href="work.css" />
          <iframe
            class="frame"
            src="https://www.slideshare.net/slideshow/embed_code/key/ldxkO6woqJgUe2"
          ></iframe>
        </div>
      </React.Fragment>
    );
  }
}
export default Work;
